package service

import (
	"encoding/base64"
)

func (t *templateService) fileDirectoryPublic() {
	t.files = append(t.files, &templateFile{
		name:  "public/openapi/index.html",
		parse: true,
		body: `
<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1">
    <title>{{ .Global.ProductCode }}-{{ .Global.ShortName }}-{{ .Template.Service.APIVersion }}</title>
    <style>
      body {
        margin: 0;
        padding: 0;
      }
    </style>
  </head>

  <body>
    <redoc spec-url='./microservice.swagger.json'></redoc>
    <script src="./redoc.standalone.js"> </script>
  </body>
</html>
`,
	})

	// 内容包含特殊字符，使用base64编码保存在转换
	tmplBase64 := `
`

	tmplBody, err := base64.StdEncoding.DecodeString(tmplBase64)
	if err != nil {
		tmplBody = []byte("base64 decode string error")
	}
	t.files = append(t.files, &templateFile{
		name: "public/openapi/redoc.standalone.js",
		body: string(tmplBody),
	})

	t.files = append(t.files, &templateFile{
		name:  "public/admin/.not-empty-dir.txt",
		parse: true,
		body: `
# Code generated by "grpc-kit-cli/{{ .Global.ReleaseVersion }}". DO NOT EDIT.
#
# https://grpc-kit.com/docs/spec-cfg/frontend/
#
# 用于解决空目录下使用 go:embed admin/* 失败，如目录下无内容，请不要删除。
`,
	})

	t.files = append(t.files, &templateFile{
		name:  "public/webroot/.not-empty-dir.txt",
		parse: true,
		body: `
# Code generated by "grpc-kit-cli/{{ .Global.ReleaseVersion }}". DO NOT EDIT.
#
# https://grpc-kit.com/docs/spec-cfg/frontend/
#
# 用于解决空目录下使用 go:embed webroot/* 失败，如目录下无内容，请不要删除。
`,
	})

	t.files = append(t.files, &templateFile{
		name:  "public/embed.go",
		parse: true,
		body: `
// Code generated by "grpc-kit-cli/{{ .Global.ReleaseVersion }}". DO NOT EDIT.

package public

import (
	"embed"
)

//go:embed admin/*
//go:embed openapi/*
//go:embed webroot/*
var Assets embed.FS
`,
	})
}
